import { BrowserRouter as Router } from 'react-router-dom';
import Landing from './Landing';
import Cookies from 'js-cookie';

function App() {
    const is_logged_in = Cookies.get('login') === 'true';
  
    return (
      <Router>
        {is_logged_in ? (
          <div>
          You are not logged in. Please log in.
        </div>
        ) : (
          <Landing />
        )}
      </Router>
    );
  }

export default App;
